import { h } from '@stencil/core';
/**
 * Se define un  template que se adapta al 100% del ancho
 * del padre que lo contentenga.
 * Tiene dos filas contenedores:
 * 1 -> Cabecera
 * 2 -> Cuerpo
 */
export class Pulseflowtm {
    hostData() {
        return;
    }
    render() {
        return (h("div", { class: "flowtm-main" },
            h("div", { class: "flowtm-main--container pulse-grid" },
                h("header", { class: "row flowtm-main--container--header" },
                    h("div", { class: "col-xs-12 col-md-10 col-lg-10 col-md-offset-1 col-lg-offset-1" },
                        h("slot", { name: "header" }))),
                h("section", { id: "content", class: "row flowtm-main--container--content" },
                    h("div", { class: "col-xs-12 col-md-10  col-md-offset-1" },
                        " ",
                        h("slot", { name: "content" }),
                        " ")))));
    }
    static get is() { return "pulse-flowtm"; }
    static get encapsulation() { return "shadow"; }
    static get originalStyleUrls() { return {
        "$": ["pulse-flowtm.scss"]
    }; }
    static get styleUrls() { return {
        "$": ["pulse-flowtm.css"]
    }; }
    static get elementRef() { return "element"; }
}
